package cn.xgame.config.o;import java.util.Map;import x.javaplus.string.StringUtil;public class ShipPo {	public final int id;	public final short wroom;	public final short eroom;	public final short groom;	public final int en;	public final int hp;	public final int mess;	public final int control;	public final int def;	public final int type;	public final int push;	public final float pushratio;	public final String answer;

	public ShipPo( ShipPo clone ){		this.id = clone.id;		this.wroom = clone.wroom;		this.eroom = clone.eroom;		this.groom = clone.groom;		this.en = clone.en;		this.hp = clone.hp;		this.mess = clone.mess;		this.control = clone.control;		this.def = clone.def;		this.type = clone.type;		this.push = clone.push;		this.pushratio = clone.pushratio;		this.answer = clone.answer;

	}	public ShipPo( Map<String, String> data ){		id = Integer.parseInt( StringUtil.convertNumberString( data.get("id") ) );		wroom = Short.parseShort( StringUtil.convertNumberString( data.get("wroom") ) );		eroom = Short.parseShort( StringUtil.convertNumberString( data.get("eroom") ) );		groom = Short.parseShort( StringUtil.convertNumberString( data.get("groom") ) );		en = Integer.parseInt( StringUtil.convertNumberString( data.get("en") ) );		hp = Integer.parseInt( StringUtil.convertNumberString( data.get("hp") ) );		mess = Integer.parseInt( StringUtil.convertNumberString( data.get("mess") ) );		control = Integer.parseInt( StringUtil.convertNumberString( data.get("control") ) );		def = Integer.parseInt( StringUtil.convertNumberString( data.get("def") ) );		type = Integer.parseInt( StringUtil.convertNumberString( data.get("type") ) );		push = Integer.parseInt( StringUtil.convertNumberString( data.get("push") ) );		pushratio = Float.parseFloat( StringUtil.convertNumberString( data.get("pushratio") ) );		answer = data.get("answer");

	}}